import React from 'react';

const RegForm = ()=>{
    
    return (
        <>
            <h1>Registration Form</h1>
            <form>
            <input type='text' name='fname' />
            <input type='text' name='lname'/>
            <input type='email' name='email'/>
            <input type="submit">Submit</input>

            </form>
        </>
    );
}

export default RegForm;
